Rabu 25 Agustus 2021, Siang tadi.
Kecamatan Medan Johor  melaksanakan kegiatan ppkm darurat level 4 covid19.

Tim terdiri dari: Satpol-PP, Brimob, Polsek Deli tua,Sabara Polda,riskimsus Polda, trantib kecamatan Medan Johor, Kepling pangkalan masyur.

Lokasi Kegiatan :

1. Royal Gaming Arena, Jl Karya Jaya No. 77 A, Kel. Pangkalan Masyur

2. Hai Johor 74, Jl Karya Jaya, Kel. Pangkalan Masyur 

3. Asrama Copi, Jl Ah Nasution Komplek Metro Link, Kel Pangkalan Masyur

4. Jus Kuphi Medan, Jl Ah Nasution Komplek Metro Link 

Tindakan yang dilakukan:
Sosialisasi Perpanjangan  PPKM Darurat Level 4 Covid 19 dari Tanggal 24 Agustus 2021 s/d 6 September 2021

